import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
const Nav = () =>{
	return(
			<ul class="nav nav-pills float-right">
			  <li class="nav-item">
			    <a class="nav-link disabled" href="#">Log In</a>
			  </li>
			  <li class="nav-item">
			    <a class="nav-link disabled" href="#">Sign Up</a>
			  </li>
			</ul>
		);
}
export default Nav;
